function query(data) {
  // Check if the data is null or undefined
  if (data === null || data === undefined) {
      return 'NULL';
  }
  // Check if the data type is a string
  if (typeof data === 'string') {
      // Return formatted string or 'NULL' if the string is empty
      return data.trim() !== '' ? `'${data.replace(/'/g, "''").trim()}'` : 'NULL';
  } else {
      // Handle numeric data: Remove commas, parse, and handle NaN cases
      let parsed = parseFloat(data.toString().replace(/,/g, ''));
      return isNaN(parsed) ? '0' : parsed;
  }
}



function QEXE(data){
  let sql = [];
  let plant = 'SVI2';
  let temp_data = null;
  data.forEach((entry, index) => {
      //////////  MAIN  ////////
      let cplk_m_item_qy_old =  entry.cplk_m_item_qy_old ?? null;
      let cplk_m_item_qy_new =  entry.cplk_m_item_qy_new ?? null;
      if (true) {
        temp_data = ` 
        UPDATE  OP_DOC_CTRL.dbo.mat_ctrl_neomps_routing
        SET cplk_m_item_qy_old = ${cplk_m_item_qy_old} and cplk_m_item_qy_new = ${cplk_m_item_qy_new}
        WHERE plant = ${plant}  and summary = 'I' and  level_no = 0
        (fg_material_no = ${query(entry.fg_material_no)} and component_no = ${query(entry.fg_material_no)} and material_no = ${query(entry.fg_material_no)})
        `;
        sql.push(temp_data);
      }
  });
  return sql;
}

